import sys

def main():
    n = int(sys.stdin.readline().strip())
    a = [int(x) for x in sys.stdin.readline().strip().split()]
    if a[0] > 0:
        print("first")
    elif a[0] < 0:
        print("second")
    else:
        for i in range(1, n):
            if a[i] > 0:
                if a[i-1] < 0:
                    print("first")
                    break
            elif a[i] < 0:
                if a[i-1] > 0:
                    print("second")
                    break
            else:
                if a[i-1] > 0:
                    print("first")
                    break
                elif a[i-1] < 0:
                    print("second")
                    break

if __name__ == '__main__':
    main()
